import React from "react";
import Layout from "../components/Layouts/BasicLayout";
import Girl from "svg-react-loader?name=Girl!../public/404-colored.svg";

const Custom404 = () => {
  return (
    <Layout>
      <h3>Błąd - nie znaleziono podstrony</h3>
      <Girl className="girl-svg" />

      <style jsx>
        {`
          @media (min-width: 1024px) {
            h2 {
              text-align: center;
            }
          }
        `}
      </style>

      <style global jsx>
        {`
          .girl-svg {
            max-width: 100%;
            margin-top: 30px;
          }

          @media (min-width: 640px) {
            .girl-svg {
              max-width: 50%;
            }
          }

          @media (min-width: 1024px) {
            .girl-svg {
              margin-top: 30px;
              max-width: 500px;
              margin: 0 auto;
            }
          }
        `}
      </style>
    </Layout>
  );
};

export default Custom404;
